import React from 'react';

import HeaderAluno from '../../../components/headerAluno/index';
import Footer from '../../../components/footer/index';
import { motion } from 'framer-motion';


import './style.css';
import { Link } from 'react-router-dom';



function VagasAluno(){

    const pageTransition = {
        duration: 1
    }
    
    const pageVariante = {
        in: {
            opacity: 1,
            x: 0
        },
        out:{
            opacity: 0,
            x: "-180vw"
        }
    }

    return(
        <div>
            <HeaderAluno/>
            <nav className="menulista">
                <ul className="menu">
                    <li><Link  className="cool-link" to="/vagasAluno">Vagas disponíveis</Link></li><br/>
                    <li><Link  className="cool-link" to="/vagasInscrito">Minhas inscrições</Link></li><br/>
                </ul>
                    <div className="hr">
                        <hr/>
                    </div>
            </nav>
            <motion.div exit="out" animate="in" initial="out"  variants={pageVariante} transition={pageTransition} >
        
            </motion.div>

            <Footer/>
        </div>
    );


    
}

export default VagasAluno;
